import { Tab, Nav, NavDropdown, NavItem } from "react-bootstrap";
import { useState } from "react";
import "bootstrap/dist/css/bootstrap.min.css";

const Topbar = () => {
  const [activeKey, setActiveKey] = useState("pizza");
  return (
    <Tabs
      defaultActiveKey="Dados Pessoais"
      id="uncontrolled-tab-example"
      className="mb-3"
    >
      <Tab eventKey="home" title="Dados Pessoais" className="home">
        <h1>Home</h1>
      </Tab>
      <Tab eventKey="profile" title="Formação"></Tab>
      <Tab eventKey="contact" title="Experiência"></Tab>
    </Tabs>
  );
};

export default Topbar;
